import React from "react";
import { Route } from "react-router-dom";
// import HomePage from "./pages/homepage";
import "./App.css";

const HomePage = () => {
  return <h1>Home page</h1>;
};

function App() {
  return (
    <div className="App">
      <Route exact component={HomePage} />
    </div>
  );
}

export default App;
